//234567890123456789012345678901234567890123456789012345678901234567890123456789

class Solution {
public:
    int minSubarray(vector<int>& nums, int p) {
        if( p == 1 ) return 0;

        // numssum max 10e5 x 10e9 = 10e14
        long long int init = 0;
        long long int numssum = accumulate(nums.begin(), nums.end(), init);
        if ( numssum < p ) return -1;

        int rem = numssum % p; // target remainder
        if( rem == 0 ) return 0;

        auto n = nums.size();
        if( n == 1 ) return -1;

        int r = n;

        unordered_map<int,int> mp;
        mp.insert({0,-1});
        long long int rs = 0; // running sum
        for(auto it = nums.begin(); it != nums.end(); ++it) {
            auto pos = distance(nums.begin(), it); // current idx

            rs += *it;
            int cur = rs % p; // remainder of the running sum

            // find the most recent subarray, whos sum's remainder
            // is a compliment to our current remainder
            int t = (cur - rem) % p;
            // wrap in case current remainder less than original remainder
            if( t < 0 ) t += p;
            auto f = mp.find( t );
            if( f != mp.end() )
                r = min(r, (int) pos - f->second);

            // save pos of current remainder
            // as we are looking for the min subarray length, we only need
            // to keep the most recent position for the current remainder
            mp.insert_or_assign(cur,pos);
        }

        return ( r == n ) ? -1 : r;
    }

};

